	int NO_OF_WORDS=5000;
	int PAGE_LENGTH= 30;
	int par[]=new int[NO_OF_WORDS+1];
	double cost[]=new double [NO_OF_WORDS+1];
	public static void main(String[] args) {
		Text_Packing_Doc tp=new Text_Packing_Doc();
		tp.init();
		tp.DP();
		tp.print();
	}

	void print()
	{
		int pointer=0;
		while(pointer<5000)
		{
			int index=par[pointer];
			for(int j=pointer;j<index;j++)
				System.out.print(arr[j]+" ");
			System.out.println(index);
			pointer=index;
		}
	}
	void init()
	{
		cost[NO_OF_WORDS]=0;
	}
	void DP()
	{
		for(int i=NO_OF_WORDS-1;i>=0;i--)
		{
			double val=Double.MAX_VALUE;
			int j_val=0;
			for(int j=NO_OF_WORDS;j>=i+1;j--)
			{
				double wcost= cost[j]+badness(i, j) ;
				if(wcost<val)
				{
					val=wcost;
					j_val=j;
				}
			}
			cost[i]=val;
			par[i]=j_val;
		}
		System.out.println(cost[0]);
	}

	double badness(int i,int j)
	{
		double len=0;
		for(int k=i;k<j;k++)
		{
			len=len+arr[k].length();
		}
		len=len+j-i-1;

		if(len>PAGE_LENGTH)
			return Double.MAX_VALUE;
		else
			return Math.pow(PAGE_LENGTH-len, 3);
	}

